injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-51681126971e9",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/alexj/prog/alexcodes-vue/README.md").then(comp => {
        Vue.component("v-51681126971e9", comp.default)
        next()
